import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';

function My_Card(props) {

    return (


        <Card variant="light">
          <Card.Img variant="top" src={Articles[props.i].img} />
          <Card.Body>
            <Card.Title className='fs-3' >{Articles[props.i].title}</Card.Title>
            <Card.Text className='crop-text-2' >
              {Articles[props.i].description}
            </Card.Text>

            <Row >

              <Col md="auto">
                <Card.Text>
                  {Articles[props.i].author}
                </Card.Text>
              </Col>

              <Col md="auto" className="vl p-0" />

              <Col md="auto">
                <Card.Text >
                  {Articles[props.i].author}
                </Card.Text>
              </Col>

            </Row>

          </Card.Body>

        </Card>


    )
}

export default My_Card;
